import React, { useState } from "react";
import {
  Card,
  CardContent,
  Typography,
  TextField,
  Button,
  Box,
  CircularProgress,
} from "@mui/material";
import { Sun, Cloud, CloudRain } from "lucide-react";
import {
  LineChart,
  Line,
  XAxis,
  YAxis,
  CartesianGrid,
  Tooltip,
  Legend,
  ResponsiveContainer,
} from "recharts";

const WeatherDashboard = () => {
  const [city, setCity] = useState("");
  const [weather, setWeather] = useState(null);
  const [historicalWeather, setHistoricalWeather] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);

  const fetchWeather = async () => {
    setLoading(true);
    setError(null);
    try {
      const currentWeatherResponse = await fetch(
        `/api/weather?city=${encodeURIComponent(city)}`
      );
      const historicalWeatherResponse = await fetch(
        `/api/historical-weather?city=${encodeURIComponent(city)}`
      );

      if (!currentWeatherResponse.ok || !historicalWeatherResponse.ok) {
        throw new Error("City not found or data unavailable");
      }

      const currentData = await currentWeatherResponse.json();
      const historicalData = await historicalWeatherResponse.json();

      setWeather(currentData);
      setHistoricalWeather(historicalData);
    } catch (error) {
      setError(error.message);
    } finally {
      setLoading(false);
    }
  };

  const WeatherIcon = ({ condition }) => {
    const iconProps = { size: 48 };
    switch (condition.toLowerCase()) {
      case "clear":
        return <Sun {...iconProps} color="#FFD700" />;
      case "clouds":
        return <Cloud {...iconProps} color="#A9A9A9" />;
      case "rain":
        return <CloudRain {...iconProps} color="#4682B4" />;
      default:
        return <Cloud {...iconProps} color="#A9A9A9" />;
    }
  };

  return (
    <Box maxWidth="md" margin="auto" mt={4}>
      <Card>
        <CardContent>
          <Typography variant="h4" gutterBottom>
            Weather Dashboard
          </Typography>
          <Box display="flex" mb={2}>
            <TextField
              fullWidth
              value={city}
              onChange={(e) => setCity(e.target.value)}
              placeholder="Enter city name"
              variant="outlined"
            />
            <Button
              variant="contained"
              color="primary"
              onClick={fetchWeather}
              disabled={loading}
              sx={{ ml: 1 }}
            >
              {loading ? (
                <CircularProgress size={24} color="inherit" />
              ) : (
                "Get Weather"
              )}
            </Button>
          </Box>
          {error && (
            <Typography color="error" align="center" mb={2}>
              {error}
            </Typography>
          )}
          {weather && (
            <Box textAlign="center" mb={4}>
              <WeatherIcon condition={weather.condition} />
              <Typography variant="h5" mt={1}>
                {weather.temperature}Â°C
              </Typography>
              <Typography variant="h6">{weather.condition}</Typography>
              <Typography variant="body1" color="textSecondary">
                {weather.description}
              </Typography>
              <Typography variant="body2" color="textSecondary" mt={1}>
                {weather.city}
              </Typography>
            </Box>
          )}
          {historicalWeather && (
            <Box>
              <Typography variant="h6" mb={2}>
                Historical Weather Data
              </Typography>
              <ResponsiveContainer width="100%" height={300}>
                <LineChart data={historicalWeather.historical_data}>
                  <CartesianGrid strokeDasharray="3 3" />
                  <XAxis dataKey="date" />
                  <YAxis />
                  <Tooltip />
                  <Legend />
                  <Line
                    type="monotone"
                    dataKey="temperature"
                    stroke="#8884d8"
                    activeDot={{ r: 8 }}
                  />
                </LineChart>
              </ResponsiveContainer>
            </Box>
          )}
        </CardContent>
      </Card>
    </Box>
  );
};

export default WeatherDashboard;
